import "./NewExpenseItem.css";

import ExpenseDate from "./ExpenseDate";

function NewExpenseItem(props) {
  return (
    <div className="expenses">
      <ExpenseDate date={props.date} />
      <div>
        <h2>{props.title}</h2>
        <div>${props.price}</div>
      </div>
    </div>
  );
}

export default NewExpenseItem;
